import React from "react";
import Card from "./Card";
import Sdata from "./Service-data";


const Service =()=>{
    return(
        <>
         {Sdata.map((val , index , array) => {
            return(
                <Card
                key = {val.id}
                imgsrc = {val.imgsrc}
                title = {val.title}
                heading = {val.heading}
                />
            )
        })} 
    </>
    )
}
export default Service;
